import React,{Component} from 'react';

class Calculator extends Component{
    render(){
        return(
            <div>
                <ul>
                    <li>1.Sumar</li>
                    <li>2.Restar</li>
                </ul>
            </div>
        );
    }
}

export default Calculator;
